import './App.css';
import axios from 'axios';
import { useState, useEffect } from "react";
import {BrowserRouter as Router , Route, Switch} from 'react-router-dom'
import Home from './pages/Home';

function App() {

  return (
    <Router>
    <div className="App">
      <h1>Selam</h1>
      <Switch>
        <Route path="/">
            <Home/>
        </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
